import React, { } from 'react';
import {
  Link
} from "react-router-dom";

import SwitchComp from './components/switch';

function App() {

  return (

    <div className="App">
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/contentdatas">ContentData</Link>
      </li>
      <li>
        <Link to="/users">Users</Link>
      </li>


      <SwitchComp />
    </div >

  );
}



export default App;


